import React from 'react';
import Task from "../task/task";
import TaskToggle from "../task-toogle/task-toggle";

const TaskListItem = ({className, id, testFun}) => {




    if(className === 'completed') {
        return <li className={className}><Task  testFun={testFun} mainClass={className} id={id}/></li>
    }
    else if(className === 'editing') {
        return (<li  className={className}>
                <Task className='view' label={className} id={id}/>
                <TaskToggle type="text" className="edit" value="Editing task"/>
             </li>);
    }
    else {
        return  <li className={className} ><Task id={id}   mainClass={className} testFun={testFun}/></li>
    }



};

export default TaskListItem;
